import './main.css'
import React, {useState} from "react";

function ListsDisplay(props) {
    return (
        <div className="list-box" id="list-box-1">
            <p id="list-1">
                <img src="listIcon.png"/>
                <span onClick={() => props.onClick(props.list.id)}>{props.list.title}</span>
                <img id="edit-button" onClick={""} src={"edit-solid.svg"}></img>
            </p>

            <hr/>
        </div>
    )
}

function MainPage(props) {
    return (
        <div>
            <h1 id="MyLists">My Lists</h1>
            {props.data.map((x) => <ListsDisplay list={x} onClick={props.onListClick}/>)}
            <div id="button1">
                <button onClick={() => props.setShowAlert(true)} id="addTask">
                    <img src="plus_best.png"/>
                    <span>Add List</span>
                </button>
            </div>
        </div>
    )
}

export default MainPage;
